import { Background, Caption, VideoPlaceholder } from "./styles";
import { Heading, Paragraph } from "../Text";

import Grid from "../Grid";
import React from "react";

export default () => {
	return (
		<Background>
			<Grid>
				<Caption>
					<Heading>London's Stories</Heading>
					<Paragraph>
						When people talk about how the gospel can change the
						world they start talking about{" "}
						<i>what God has done in London</i>.
					</Paragraph>
				</Caption>
				<VideoPlaceholder />
			</Grid>
		</Background>
	);
};
